/*!50003 PROCEDURE `sp__generate_necromancer_equips`()
BEGIN

DECLARE CLASS_NECROMANCER INT DEFAULT 18;

DECLARE NPCBOT_ENTRY_BEGIN INT DEFAULT 70575;
